import random
from typing import List
import re


class Solution:
    def suggestedProducts(self, products, searchWord):
        result = list() 
        products.sort()
        for i in range(1, len(searchWord)+1):
            products = list(filter(lambda x: x.startswith(searchWord[:i]), products))
            result.append(products[:3])
        return result


